import styled from 'styled-components';

export const CollectionPreviewContainer = styled.div`
  display: flex;
  flex-direction: column;
  margin-bottom: 30px;

  .title {
    font-size: 28px;
    margin-bottom: 25px;
    cursor: pointer;

    &:hover {
      color: grey;
    }
  }

  .preview {
    display: flex;
    justify-content: space-between;
  }
`;
